values:
There was a bunch of stuff I wanted to do tonight, but I've just been miserable. Sickly and grumpy and angry. I had to stop watching TV because every show I watched people were being so... annoying. Self-serving. Egotistical. Mean. I don't know. Bad things happen to good people. stupid world.&nbsp;
Things are all kind of&nbsp;nutty right now. Lisa's coming here for a visit next week. on her way to Maine, where she is moving to. It is crazy, but I think it&nbsp;is a good thing for her. As long as she is happy and safe, I can be&nbsp;content with that. &nbsp;Which means I won't have a place to stay in Victoria anymore, but since I don't have a lot of extra money, that is probably for the best.&nbsp;
School is... I don't know. I think I'm becoming more and more disillusioned and embittered&nbsp;each week. I know in the past I've had problems with just trying too hard, and then nothing works out. But usually&nbsp;I never know when&nbsp;I'm trying to hard until it all comes apart, and it blows up in&nbsp;my face. One would think determination and perciverience would be a good thing, but when is it time to cut my losses and step back, to get some perspective? Most of my midterms were awful. And by awful, I mean I got pretty much the class average in each one. Which shouldn't be too heart breaking, except that I've never been an average student, I've always been like, an A student. or a high B. I will never get into grad school if I keep getting average. I need a job. I need my lisence. I need to buck up and feel better. I need to finish my christmas shopping. 
I've finally made some friends here, gone out a few times. I actually went to a club here this weekend... it was lame-ass. Well, compared to Victoria. I still danced all night, and got hit on my funny drunk guys. But they played country music! well, not ALL... but more than they could get away with in Vic. And I wasn't at the cowboy bar! And the venue is just tiny.. I mean, I could easily see to the other side of the room. And then I was lonely and homesick, because the girls I was with knew like, half the bar, from school or TRU or work or whatever, and I knew 3 people. No asian mullet man. No dancing girls. No friendly bar tenders or familliar bouncers. No ex's of Lisa's or erin's or whoever. certainly no other belmont kids.&nbsp;

Gah... I'm totally being emo tonight. I'm even listening to emo-y music, I am so very cliche right now. Why aren't you people answering your phones? Don't you know I want to call you up and whine and talk about myself all night? come on now!
